import React, { useEffect } from 'react';

function MainPath() {

    useEffect(()=>{
        fetch('http://localhost:8080/sectionsData')
          .then(result=>{
            console.log(result);
            result.json(finalData=>{
                console.log(finalData);
            })
          })
    },[])

    return (
        <div className='main-path'>
            <div className='main-section'></div>

        </div>
    );
}

export default MainPath;
